import React from 'react';
import { Container, Inputs } from './styles';
import { Formik as FormikBentcare, Button } from '@bentcare/core';
import { Formik, Form } from 'formik';
const { Field } = FormikBentcare;

const SixthSection: React.FC = () => {
  return (
    <Container>
      <div className="contact">
        <h5>Contato</h5>
        <h4>Telefone: 11 96403-2001</h4>
        <span>Franca</span>
        <p>
          Rua Manoel Valim, 525 –<br />
          3º Andar contato@bentcare.com.br
        </p>
      </div>
      <div className="form">
        <Formik initialValues={{}} onSubmit={() => {}}>
          <Form>
            <Inputs>
              <p>Receba ofertas e novidades por e-mail</p>
              <Field name="nome" type="text" placeholder="Nome" />
              <Field name="email" type="email" placeholder="E-mail" />
              <Button
                appearance="primary"
                fullWidth
                label="Quero ficar por dentro"
              />
            </Inputs>
          </Form>
        </Formik>
      </div>
    </Container>
  );
};

export default SixthSection;
